  const [isEditing, setIsEditing] = useState(false);

  const showMainForm = () => {};

  return (
    <Card className="main-form">
      {!isEditing && <button type="button" onClick={showMainForm}>Add Expense</button>}
    </Card>
  );
};

export default AddExpenseForm;
